import React from 'react'

const DataContext =React.createContext ({
  testF:()=>{},
  test:true
})

export default DataContext


export const DataContextProvider=(props)=>{
    
    const consoleFu=(props)=>{
        console.log(props);
    }

    return <DataContextProvider value={{
        testF:consoleFu()
    }} >
        {props.children}
    </DataContextProvider>    
}
